  let settings = {
    dots: false,
    infinite: true,
    speed: 500,
    slideToShow: 1,
    slideToScroll: 1,
    autoplay: true,
  };
  return (
    <nav className="container text-white p-8 dark:bg-gray-900">
      <div className="">
